import { keywordState, pageState, searchResultState, totalCountState } from 'states/movie'
import { useFirstRender } from 'hooks'
import { getMovieSearchApi } from 'services/movie'

import SearchResult from '../searchResult'
import styles from './movies.module.scss'

const SearchResultMovie = () => {
  const [movies] = useRecoilState(searchResultState)

  return (
    <>
      {movies.map((movie) => (
        <SearchResult key={movie.imdbID} movie={movie} />
      ))}
    </>
  )
}

export default SearchResultMovie
